class Solution(object):
    def find132pattern(self, nums):
        """
        :type nums: List[int]
        :rtype: bool
        """

        length = len(nums)
        for i in range(length-2):
            for j in range(i+1, length-1):
                for k in range(j+1, length):
                    if nums[i] < nums[k] < nums[j]:
                        return True
        return False
        
